import React from 'react';



function NewsPreview(props) {

    return (
        <div>
            <a href="">
            <img src={props.image} alt="" />
            <h3>Farming assistant app Agrolly wins IBM's Call for Code contest</h3>
            <p>Brazil</p>
            <p>Oct, 13, 2020</p>
            </a>
        </div>
    )
}

export default NewsPreview;
